import React from 'react';
import './App.css';
import Menu from './Menu';
import Classificacao from './Classificacao';
import Escalacao from './Escalacao';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';


function App() {
  return (
    <Router>
      <div>
        <Menu />
        <Switch>
          <Route path="/classificacao" component={Classificacao}></Route>
          <Route path="/escalacao" component={Escalacao}></Route>
        </Switch>      
      </div>
    </Router>

  );
}

export default App;
